import React, { Component, useState } from "react";
import 'bootstrap/dist/css/bootstrap.css';

const MyForm = () => {
    const [inputValue, setInputValue] = useState('');

    const handleSubmit = async (event) => {
        event.preventDefault();
        const data = { input: inputValue };
        console.log("aaaaaaaaaaaa" + inputValue)
        const response = await fetch('/my-api-endpoint/', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(data)
        });
        const jsonResponse = await response.json();
        console.log(jsonResponse);
    };

    return (
        <form onSubmit={handleSubmit}>

            <input class="form-control col-xs-2" type="text" name="data" value={inputValue} onChange={e => setInputValue(e.target.value)} />

            <button class="btn btn-primary mt-3" type="submit">Submit</button>
        </form>
    );
};

export default MyForm;
